class Validator:
    @staticmethod
    def is_valid_api_id(api_id: str, valid_length: int = 32) -> bool:
        try:
            if len(api_id) < valid_length:
                if api_id.isdigit():
                    return True
                else:
                    log.warning(f'ÊÑèÂ§ñÁöÑÂèÇÊï∞:"{api_id}",‰∏çÊòØ„ÄåÁ∫ØÊï∞Â≠ó„ÄçËØ∑ÈáçÊñ∞ËæìÂÖ•!')
                    return False
            else:
                log.warning(f'ÊÑèÂ§ñÁöÑÂèÇÊï∞,Â°´ÂÜôÁöÑ"{api_id}"ÂèØËÉΩÊòØ„Äåapi_hash„Äç,ËØ∑Â°´ÂÖ•Ê≠£Á°ÆÁöÑ„Äåapi_id„Äç!')
                return False
        except (AttributeError, TypeError):
            log.error('ÊâãÂä®ÁºñËæëconfig.yamlÊó∂,api_idÈúÄË¶ÅÊúâÂºïÂè∑!')
            return False

    @staticmethod
    def is_valid_api_hash(api_hash: str, valid_length: int = 32) -> bool:
        return len(str(api_hash)) == valid_length

    @staticmethod
    def is_valid_bot_token(bot_token: str, valid_format: str = ':') -> bool:
        if valid_format in bot_token:
            return True
        else:
            return False

    @staticmethod
    def is_valid_links_file(file_path: str, valid_format: str = '.txt') -> bool:
        file_path = os.path.normpath(file_path)
        return os.path.isfile(file_path) and file_path.endswith(valid_format)

    @staticmethod
    def is_valid_save_path(save_path: str) -> bool:
        if not os.path.exists(save_path):
            while True:
                try:
                    question = console.input(f'ÁõÆÂΩï:"{save_path}"‰∏çÂ≠òÂú®,ÊòØÂê¶ÂàõÂª∫? - „Äåy|n„Äç(ÈªòËÆ§y):').strip().lower()
                    if question in ('y', ''):
                        os.makedirs(save_path, exist_ok=True)
                        console.log(f'ÊàêÂäüÂàõÂª∫ÁõÆÂΩï:"{save_path}"')
                        break
                    elif question == 'n':
                        break
                    else:
                        log.warning(f'ÊÑèÂ§ñÁöÑÂèÇÊï∞:"{question}",ÊîØÊåÅÁöÑÂèÇÊï∞ - „Äåy|n„Äç')
                except Exception as e:
                    log.error(f'ÊÑèÂ§ñÁöÑÈîôËØØ,ÂéüÂõ†:"{e}"')
                    break
        return os.path.isdir(save_path)

    @staticmethod
    def is_valid_max_download_task(max_tasks: int) -> bool:
        try:
            return int(max_tasks) > 0
        except ValueError:
            return False
        except Exception as e:
            log.error(f'ÊÑèÂ§ñÁöÑÈîôËØØ,ÂéüÂõ†:"{e}"')

    @staticmethod
    def is_valid_enable_proxy(enable_proxy: str or bool) -> bool:
        if enable_proxy in ('y', 'n'):
            return True

    @staticmethod
    def is_valid_is_notice(is_notice: str) -> bool:
        if is_notice in ('y', 'n'):
            return True

    @staticmethod
    def is_valid_scheme(scheme: str, valid_format: list) -> bool:
        return scheme in valid_format

    @staticmethod
    def is_valid_hostname(hostname: str) -> bool:
        return isinstance(ipaddress.ip_address(hostname), ipaddress.IPv4Address)

    @staticmethod
    def is_valid_port(port: int) -> bool:
        try:
            return 0 < int(port) <= 65535
        except ValueError:  # Â§ÑÁêÜÈùûÊï¥Êï∞Â≠óÁ¨¶‰∏≤ÁöÑÊÉÖÂÜµ
            return False
